CREATE TABLE `bdc_carga_fam` (
  `codg_per` int(11) NOT NULL DEFAULT '0' COMMENT 'Cédula personal',
  `codg_carga_fam` int(11) NOT NULL DEFAULT '0' COMMENT 'Cédula del familiar',
  `apel_carga_fam` varchar(100) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Apellidos del familiar',
  `nomb_carga_fam` varchar(100) COLLATE utf8_spanish2_ci NOT NULL COMMENT 'Nombres del familiar',
  `fec_nac_carga_fam` date DEFAULT '0000-00-00' COMMENT 'Fecha del familiar',
  `sexo_carga_fam` char(1) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'sexo del familiar',
  `paren_carga_fam` char(1) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'parentesco del familiar',
  `estudia_carga_fam` char(1) COLLATE utf8_spanish2_ci DEFAULT '',
  `nivel_est_carga_fam` char(1) COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Nivel de estudio del familiar',
  PRIMARY KEY (`codg_per`,`codg_carga_fam`),
  CONSTRAINT `bdc_carga_fam_ibfk_1` FOREIGN KEY (`codg_per`) REFERENCES `bdc_datos_per` (`codg_per`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;
